const modalObject = ({thingInfo, handleClose, handleChange}) => {
    return (
        <dialog id="modal-thing" open>
            <article>
                <a href="#thisModalIsHiddenBecauseItWasAnnoying" aria-label="Close" className="close" data-target="modal-thing" onClick={handleClose}>Close</a>
            <hgroup>
                    <p>This is stuff in a modal?</p>
                    <hgroup>
                        <a className="outline" href="#" role="button" onClick={() => {
                            handleChange(Number(thingInfo.id)-1)
                        }}>Previous</a> 
                        <a className="outline" href="#" role="button" onClick={() => {
                            handleChange(Number(thingInfo.id) +1)
                        }}>Next</a>
                    </hgroup>
            </hgroup>
            </article>
        </dialog>
    )
}

export default modalObject;
